(8, '1A4B9E6EAF416EA26', '', '50011-35568_3830614972533_1221087902_n.png', 'nadia-logo-label.png', 'KOLEKSI NADIA', '', 'akunadz@gmail.com', '085722122784', 'Nadia Puspita Sari', '0857221227', '', 'Jl.Cibeunying Permai 1 No.5a Bandung', 0, 0, 3273, 32, '', '', 0, '', 0, 0, '', 'Koleksi Nadia, menjual tas branded wanita semi super dan semi ori murah di bandung yang langsung dikirim dari jakarta, dengan fasilitas membership untuk mendapatkan diskon harga setiap hari, untuk reseller yang mau bergabung, download aplikasi nadia collection di http://sempoa.biz/coin/nadia... diskonnya bukan hanya di Koleksi Nadia aja lho, di komunitas brand Koleksi Nadia.\r\n\r\nOrder pin BB 548A89DA', 'Potongan harga Rp.20.000,- untuk setiap pembelian di Koleksi Nadia.', 'nadia', 2, '#e32500;#c61e05', 'Diskon Tas Branded Wanita Bandung Semi Super dan Semi Ori', 'diskon,tas,branded,bandung,wanita,semi super,semi ori', 'Diskon dan potongan harga tas branded wanita dan murah di bandung semi super dan semi ori,dari brand ternama berskala internasional,yang dikirim dari jakarta', 14, 39, 0, 0, 15, 0, 0, 0, 3, '0000-00-00', '2015-07-31'),
(10, '111CACCD5269A08FF', '', '477b0-1375213_610452095681283_1028467974_n.jpg', 'sicknest-logo-label.png', 'SICKNEST', '', 'aziz@gmail.com', '085722122784', 'Muhammad Aziz Amrain', '0857221448', '', 'Jl.Dalem Kaum, Parahayangan Plaza Lt.1', 0, 0, 3273, 32, '', '', 0, '', 0, 0, '', 'SICKNEST REBELLIONT adalah perusahaan / keluarga yang ditujukan untuk fashion dan gaya hidup. moto kami adalah "Pertanyaan Everything" yang bukan tentang kita mendidik anda tapi itu tentang anda mendidik diri sendiri.', 'Diskon 15% all item, untuk pembelian produk-produk sicknest clothing', 'sicknestclothing', 2, '#acacac;#dadada', '', '', '', 1, 39, 0, 0, 2, 0, 0, 0, 3, '0000-00-00', '2014-05-30'),
(12, 'E8DA74EFCE547C037', '', 'bbe3a-ganeca.jpg', 'b4f92-ganeca-logo_label.png', 'GANECA CAFE', 'http://silkatdago.herokuapp.com/', 'fo@thesilkdagohotel.com', ' +62 22 25366775', '', ' +62 22 25', '', 'Jl.Ir.H. Juanda No. 392 Dago, 40135 Bandung', 0, 0, 3204, 32, '', '', 0, '', 0, 0, '', 'Dengan konsep terbuka, kafe yang menyatu dengan lokasi The Silk at Dago Boutique Hotel di Jalan Ir H Djuanda 392-294 ini menjadi tempat yang patut dipertimbangkan. Di sini pun pengunjung bisa mendengarkan live music tanpa jarak.\r\nMeski minimalis, hidangan yang disuguhkan pun beragam dan eklektik. Mulai dari menu western, tradisional, hingga chinese food. Satu menu unggulan yang disuguhkan yakni sate lilit dan menu barbeque platter.\r\n', '', 'ganecacafe', 2, '#5c1208;#420a06', '', '', '', 1, 14, 0, 0, 2, 0, 0, 0, 2, '0000-00-00', '2014-04-30'),
(13, '7C38A77F62B142855', '', 'f5878-silkhotel80.png', 'f5878-silk-logo-label.png', 'THE SILK HOTEL', 'http://www.thesilkdagohotel.com/', 'fo@thesildagohotel.com', '+62 22 2536677', '', '+62 22 253', '', 'Jl.Ir.H. Juanda No. 392 Dago, 40135 Bandung (5.2km Dari Pusat Kota)', 0, 0, 3204, 32, '', '', 0, '', 0, 0, '', 'The Silk at Dago Boutique Hotel adalah tempat ideal untuk memulai eksplorasi di Bandung. Surga untuk beristirahat dan bersantai, hotel ini terletak hanya beberapa langkah dari beberapa tempat hiburan kota ini seperti Taman Juandan (Goa Belanda), Dago Pakar, Taman Budaya Jawa Barat, Dago Indah Golf, dan area Factory-Outlet Riau. Terdapat jalan tembus menuju Lembang yang dapat ditempuh hanya dalam waktu 20 menit saja. Fasilitas dan pelayanan oleh The Silk at Dago Boutique Hotel menjamin penginapan menyenangkan bagi para tamu. Hotel ini menyediakan akses ke sejumlah pelayanan, termasuk layanan kamar, transfer bandara, coffee shop, restoran, ruang pertemuan, dan FREE Wi-Fi. Lepaskan tekanan hari-hari Anda dengan sejumlah fasilitas mewah TV LCD + siaran kabel, mini bar, air botol gratis, dan tempat tidur ekstra panjang (&gt; 2 meter). The Silk at Dago Boutique Hotel adalah tempat yang sempurna untuk liburan yang menyenangkan.', '', 'silkhotel', 2, '#0c7784;#61c3d1', '', '', '', 1, 14, 0, 0, 1, 0, 0, 0, 2, '0000-00-00', '2014-04-30'),
