INSERT INTO `cat_clients_testimonials` (`ID_CLIENT_TESTIMONIAL`, `ID_CLIENT`, `ID_CUSTOMER`, `NAME`, `PHOTO`, `ID_PROVINCE`, `TESTIMONIAL`, `TGLUPDATE`) VALUES
(1, 61, 4569, 'Herry Dwipa', '', NULL, 'Hepifarm ini unik, dengan layanan Pre-Ordernya, udah saya gak capek-capek lagi ke pasar, saya bahkan bisa dapat harga lebih murah daripada pasar...dan sepengatahuan saya, memang bahan dasarnya segar semua alias tidak beku atau di kimiakan....keep the good job Hepifarm..thanks', '2015-11-23'),
(2, 61, 4610, 'Robby Febrian', '', NULL, 'Wah, kalo istri lagi hamil gini, peran hepifarm penting banget sepertinya buat saya, dari pada saya beli makanan diluar..mending masak sendiri lebih hemat, jadi bisa saving money buat persalinan... jadi kalo pake aplikasi Hepifarm ini, kayak, pasar induk datang ke rumah...wkakaka....nice hep, lanjootkan....', '2015-11-23'),
(3, 61, 4563, 'Dany Saputra', '', NULL, 'Saya dan istri, ketolong banget dengan Hepifarm ini, secara kita berdua punya pekerjaan masing-masing, bangun pagi udah pada ngurusin anak, kalo ada anak kecil gini, &#38;#34;Fresh dan Sehat&#38;#34; buat saya adalah kunci mati, tapi mau masak dari bahan fresh harus ke pasar dulu pagi-pagi...ampunn, dah...me dukung Hepifarm For Hepi People, Because You are What You Eat....', '2015-11-23'),
(4, 61, 4578, 'Alamsyah Alex', '', NULL, 'Gue, anak kosan cuy, tau nya cuma makan, selera gw bnuanyak.., tapi gue lupa, makan diluaran selain menunya itu-itu aja, mau menu lain yang enak malah bisa keluar duit banyak...pengen masak sendiri biar lebih hemat, tapi gw gak paham ke pasar kayak emak-emak, and gengsi gw pun kena...hihi, pas gw tau Hepifarm...Spaghetti Versi restoran padang pun skrng bisa gw bikin...Matur Suwun Hepifarm,', '2015-11-23'),
(5, 61, 4562, 'Faisal Riza', '', NULL, 'Saya adalah seorang pengusaha kuliner sekaligus eksekutif marketing sebuah perusahaan mobil, ngabisin energi banget deh, Hepifarm ini rumitnya adalah beralih ke kebiasaan lama membeli kebutuhan makan dirumah di pasar / supermarket menjadi membeli dengan klak-klik di HP, yang di uji adalah kepercayaan dan kebenarannya, tapi setalah saya mencoba sekali, dengan niat "Nothing To Loose", ntah kenapa, berasa banyak plus, dan Hepifarm termasuk berhasil merubah kebiasaan lama saya yang lama yang belibet menjadi simple...', '2015-12-01'),
(6, 61, 4594, 'Riski Sihran', '', NULL, 'Terimakasih Hepifarm, aku dan anak kosku lainnya jadi kenyang...hahahaha...pas banget buat anak kosan, yang kalo dihitung makan gulai ayam + kentang + nasi = Rp.10.000 jauh banget harganya sama makan diluaran....sarannya, lain kali, bikin bumbu kemasan dong, biar bisa langsung masak...makasih', '2015-12-05'),
(7, 61, 4558, 'Ruki Makio', '', NULL, 'Hepifarm pas banget buatku yang malas kali keluar pas weeked, macetnya itu lho, di bandung, pas pula pengen masak soto padang resep turunan keluarga, eh kebetulan Hepifarm ada layanan pre-order, ya ku manfaatin, jatuhnya makan soto padang harga indomie rebus makan di luar, semoga bisa jadi besar ya, semangat tul...eh Hepifarm', '2015-12-05');
