INSERT INTO `cat_posts` (`ID_POST`, `TITLE`, `KEYWORDS`, `DESCRIPTIONS`, `POST_TITLE`, `POST_CONTENT`, `POST_COVER`, `DESTINY`, `PARTICIPANTS`, `ID_USER`, `ID_CLIENT`, `ID_POST_PARENT`, `ID_POST_REPLY`, `AS_ARTICLE`, `TGLUPDATE`, `WKTUPDATE`) VALUES
(21, '', '', '', 'Power Of We (POW)', '&lt;p&gt;Power of We (POW) adalah sebuah formula perhitungan kekuatan merchant dalam ber-komunitas, dan mensinergikan kinerjanya didalam komunitas, semakin tinggi POW sebuah merchant, maka semakin kuat posisi dan ranking&amp;nbsp;sebuah merchant dalam komunitasnya, Dengan POW yang cukup, maka sebuah merchant dapat memilah-milah merchant yang baru bergabung di dalam komunitas nya, artinya, sebuah merchant yang memiliki POW yang cukup, dapat menyisihkan merchant baru dengan POW yang lebih kecil,&amp;nbsp;yang mungkin menjadi kompetitor &amp;nbsp;atau dianggap tidak memberikan kontribusi&amp;nbsp;di&amp;nbsp;dalam komunitas nya..&lt;/p&gt;\r\n\r\n&lt;p&gt;Dan dengan POW yang cukup, sebuah merchant, secara sistem menjadi kebal jika terdapat merchant lain ( dengan POW setara atau lebih kecil ) yang&amp;nbsp;ingin menyisihkanya didalam komunitas.&lt;/p&gt;\r\n\r\n&lt;p&gt;POW tersusun dari formula-formula kompleks&amp;nbsp;yang&amp;nbsp;tersusun dari seberapa aktif&amp;nbsp;interaksi merchant dan pelangganya,&amp;nbsp;seberapa aktif pelangganya berinteraksi dengan merchantnya, dan faktor-faktor positif lain dalam melayani dan memberikan kemudahan sepada pelangganya.&lt;/p&gt;\r\n\r\n&lt;p&gt;POW menciptakan sebuah merchant dengan&amp;nbsp;brand yang kuat, karena pelayanan yang tulus, bersemangat, bersinergi untuk merchant lainya, dan berkontribusi penuh untuk komunitasnya, dan memiliki pelanggan-pelanggan yang loyal dan berpotensi.&lt;/p&gt;\r\n', '9b641-text194_2.gif', 'umum', '', 1, 1, 0, 0, 0, '2014-07-15', '01:09:49'),
(22, '', '', '', 'Power Of We (POW)', '&lt;p&gt;Nice !!&lt;/p&gt;\r\n', '', 'umum', '', 25, 15, 21, 21, 0, '2014-07-15', '01:45:31'),
(26, '', '', '', 'Launching Forum Sempoa', '&lt;p&gt;Launching perdana Forum Sempoa.biz, mudah-mudahan bisa memberi manfaat untuk kedepanyya....thanks yipikaye aha aha cekidot&lt;/p&gt;\r\n', '', 'personal', ':1;:24;:25;:41;:14;:51;', 1, 1, 0, 0, 0, '2014-07-30', '21:49:30'),
(27, '', '', '', 'Cek Fb Koleksi Nadia..', '&lt;h2 style=&quot;font-style:italic;&quot;&gt;koleksi nadia mengucapkan mohon maaf lahir dan batin.. ^^,&lt;/h2&gt;\r\n', '', 'umum', '', 14, 8, 0, 0, 0, '2014-08-06', '19:03:38'),
(30, '', '', '', 'Apa Yang Membuat Aplikasi Discoin Anda Sangat Penting...?', '&lt;p&gt;Melayani konsumen adalah topik umum yang menjadi syarat fundamental sebuah badan usaha, tapi, pelayanan seperti apa yang dapat kita lakukan untuk konsumen kita.&lt;/p&gt;&lt;p&gt;Apakah cukup dengan ucapan &quot;Terimakasih dibarengi Senyuman?&quot;, memang etika ini termasuk memberikan layanan kepada konsumen kita masing-masing.&lt;/p&gt;&lt;p&gt;Tapi bagai mana dengan ucapan &quot;Terimakasih, Senyuman dibarengi Manfaat&quot;..maka si pengucap terimakasih, akan terlihat lebih hebat dari &quot;Terimakasi dibarengi Senyuman&quot;.&amp;nbsp;&lt;/p&gt;&lt;p&gt;Aplikasi Discoin anda , bernilai manfaat investasi bagi konsumen anda, bahkan manfaat yang sangat dasar yaitu &quot;potongan harga&quot; untuk mereka dan untuk berbagai macam kebutuhan sehari, selain bermanfaat untuk anda sebagai alat pemasaran dan branding, juga bermanfaat untuk konsumen anda.&lt;/p&gt;&lt;p&gt;Ceritakan ke seluruh sosial media yang anda miliki untuk melayani konsumen anda diluar sana.&lt;/p&gt;&lt;p&gt;Untuk pertanyaan, pertanyaan&lt;/p&gt;', '', 'komunitas', ':1;:1;', 1, 1, 0, 0, 1, '2014-12-02', '18:14:59'),
(31, 'Berkompetisi namun Tetap Pada Integritas Sendiri', 'kompetisi, anti mainstream, ', '', 'Berkompetisi namun Tetap Pada Integritas Sendiri', '<p>Kompetisi akan selalu sengit dan tidak dapat &nbsp;dihindari didalam bisnis. Tapi itu bisa sangat memberatkan bagi bisnis startup atau yang baru berdiri.&nbsp;</p><p>Jadi bagaimana pengusaha bisa memisahkan diri dari kompetisi mereka, tetapi tetap tampil apa adanya, sesuai dengan tema bisnis yang dibawa? Apa cara yang paling efektif untuk membuat merek / brand dari bisis anda berbeda dan tetap eksis?&nbsp;<br></p><p></p><p><b>Buat kepribadian merek yang unik.</b></p><p>"Kami mencoba melawan arus dengan dengan menargetkan konsumen muda dan menciptakan hal baru, merek / brand dagang yang otentik dan jauh lebih relevan untuk generasi mereka, sejak kami tidak memiliki biaya yang besar untuk pemasaran, kami menggunakan kreativitas untuk mengembangkan kepribadian brand yang terkesan menyenangkan, sopan yang beresonansi dengan konsumen kami.&nbsp;</p><p>Kami melakukan hal-hal yang pesaing kami tidak lakukan, terhubung langsung dengan member loyal kami di media sosial, dan melibatkan member /pelanggan kami dengan cara yang menyenangkan. "</p><p>--Jordan Eisenberg, Presiden, UrgentRx; EO Colorado</p><p></p><p><b>Fokus pada Interna bisnis anda sendiri.</b></p><p>"Bisnis kami menghadapi pesaing yang kaku dari tiga industri yang berbeda. Alih-alih menganalisa dan khawatir tentang apa yang mereka lakukan, kami fokus pada indikator utama untuk meningkatkan kinerja kami sendiri, dan bagaimana kita dapat menciptakan kompetisi secara internal antara staf kami untuk memacu dan memotivasi mereka secara positif.&nbsp;</p><p>Sebagai contoh, kita memiliki kompetisi internal untuk melihat, mitra waralaba kami mana yang bisa menghasilkan paling banyak rujukan kepada klien, dalam sebulan. Hal ini memungkinkan kita untuk mendorong tujuan perusahaan kami tanpa disibukkan dengan pesaing di luar. "</p><p>--Nick Friedman, Presiden, College Hunks Hauling Junk; EO Florida Tengah</p><p></p><p><b>Tetap di depan memanfaatkan teknologi.</b></p><p>"Kami secara konsisten pada posisi tebaru untuk pemanfaatan teknologi, pesaing kami menjual produk dan layanan yang sama, yang mereka miliki dalam setahun -.. Kadang-kadang lama setelahnya, mereka pun menjadi usang, namun Kami mengambil pendekatan yang berbeda, dengan melakukan percobaan dengan teknologi baru sebelum menjadi arus utama dan trend, jadi kami dapat memprediksi bagaimana teknologi itu akan dapat mengubah bisnis kami. Kami melakukan teknologi ini dengan membangun hubungan yang kuat dengan mitra penyedia teknologi kami, dan memungkinkan kita mempelajarinya dan terkadang-kadang mempengaruhi kami pada perkembangan teknologi terbaru. "</p>--Derek Goldstein, owner and CEO, Casaplex, LLC; EO DC&nbsp;<br><p></p><p></p><p><b>Mematahkan tradisi lama.</b></p><p>"Kami mematahkan tradisi dengan , menciptakan layanan yang memungkinkan pelanggan kami untuk memilih dengan tepat bagaimana mereka menginginkan sushi mereka. apakah mereka ingin maki roll dengan ayam, atau dengan semua buah, kita menciptakannya!&nbsp;</p><p>Jika mereka ingin makan sushi mereka dengan garpu, kami menyediakan peralatan. Jika mereka membenci rumput laut, kami akan menggulung sushi dengan bungkus kedelai atau merekomendasikan pangsit kami. Kami tidak menghakimi dan juga memastikan lima nilai-nilai inti kami dalam mencapai banyak cara, yag memungkinkan pelanggan untuk makan apa saja yang mereka inginkan . "</p><p>--Yuen Yung, CEO, "How Do You Roll ?" ; EO Austin</p><b>Terhubung dengan komunitas</b><br><p></p><p></p><p>"Sebagai situs daily deal lokal, kami "David" bersaing dengan "Goliath". Namun kami mampu menjual lebih banyak dari pesaing utama kami yang sebelumnya menjadi favorit masyarakat.&nbsp;</p><p>Dengan strategi, untuk setiap transaksi yang dijual, kami menyumbangkan $ 1 untuk sekolah lokal atau nirlaba yang dipilih oleh pembeli .&nbsp;</p><p>Selama empat tahun, uang yang dikumpulkan itu semakin bertambah hingga lebih dari $ 200.000, yang akhirnya diberikan kembali kepada masyarakat kami. Hal ini telah membantu kami bersaing dengan sukses melawan rival terbesar kami. "</p><p>--Wendy Jaffe, CEO, ConejoDeals.com; EO Los Angeles</p><p><b>Membangun otoritas Anda.</b><br></p><p>"Sebuah kampanye PR besar, biasanya terfokus pada sesuatu yang sedikit kontroversial atau tidak biasa untuk menimbulkan ketertarikan masyarakat. Saat ini, dalam <i>tour speaking, </i>saya&nbsp;membahas bagaimana otomatisasi memudahkan pekerjaan dan bagaimana itu menjadi hal yang baik. otomatisasi membuat perusahaan saya tidak masuk pada arus tren pemasaran yang sedang terjadi dan akhurnya membalikan situasi trend. Wawancara, artikel, podcast, dll, semua bekerja sama untuk mempromosikan ide &nbsp;ini dan keluar dari tradisi brand pesaing kami. "</p><p>--Dan Abbate, CEO, Robotaton Corp .; EO South Florida</p><br><p></p><p></p><p></p>', '709a7-swimming-competition_36771.jpg', 'umum', '', 1, 1, 0, 0, 1, '2015-06-28', '23:26:50'),
(32, 'Kekuatan Komunitas Dalam Pemasaran Dan Branding', 'Keukatan, Komunitas, Pemasaran, Brand, Branding', 'Kekuatan Komunitas Untuk Pamasaran Adalah Hal Yang Agak Terlupakan Untuk Dapat Dimanfaatkan Dalam Pemasaran Dan Meningkatkan Nilai Brand Bisnis Dan Merk', 'Kekuatan Komunitas Dalam Pemasaran Dan Branding', '<p></p><p>Saran manajemen dari akademisi\r\ndan konsultan, biasanya cenderung datang saat terjadinya isu yang terbentuk\r\nakibat siklus ekonomi yang tidak stabil atau identik menurun</p>\r\n\r\n<p>Kebanyakan solusi yang digunakan\r\nadalah berhubungan memanfaatkan tren dan teknologi baru, namun satu sisi juga\r\nmemberikan solusi yang tidak membuat kekecewaan pada konsumen karena kenaikan\r\nharga yang menjadi imbas biaya operasional pemasaran&nbsp; yang dilakukan dalam mengimplementasikan\r\nsolusi tersebut.</p>\r\n\r\n<p>Pemasaran, sering diidentikan\r\nsebagai disiplin yang hasilnya tidak dapat diukur, dan sangat rentan terhadap\r\nperubahan suasana hati manajemen tersebut.</p>\r\n\r\n<p>Dari beberapa tahun yang lalu,\r\ntidak ada CMO yang sangat dihormati, wafat, tanpa strategi Web 2.0 yang\r\ndigunakan selama hidupnya. </p>\r\n\r\n<p>Hari ini, pemasar disarankan\r\nuntuk mengarahkan resesi dengan memangkas biaya iklan 15 detik, dan mengembangkan\r\nstrategi kreatif dan memfokuskan perhatian mereka pada segmen yang kaya,\r\nhedonistik atau keduanya.</p>\r\n\r\n<p>Ada cara yang lebih baik untuk\r\nmemikirkan kembali pemasaran untuk menanggulangi penurunan progress khususnya\r\ndalam penjualan. </p>\r\n\r\n<p>Secara fundamental, Ini bukan\r\ntentang merndahkan cara anda menuju pertumbuhan, kita semua tahu bahwa tidak\r\nbekerja.</p>\r\n\r\n<p>Ini tentang menyusun kembali daftar\r\ntantangan didepan, untuk menemukan peluang baru dan mencari dengan mata terbuka\r\ntentang kebutuhan orang di sekitar kita. </p>\r\n\r\n<p>Ini tentang menemukan sumber daya\r\nuntuk mengejar pertumbuhan baru dengan melepaskan apa yang tidak lagi dihargai\r\noleh orang-orang yang kita layani.</p>\r\n\r\n<p>Ini tentang memanfaatkan hal yang\r\nsudah lama/dilupakan, nilai-nilai yang terbukti baik dalam beresonansi pada hari\r\nini dan mendukung penemuan-penemuan kembali, untuk hari esok yang lebih baik. </p>\r\n\r\n<p>Ini tentang memikirkan kembali\r\npemasaran melalui sudut pandang masyarakat.</p>\r\n\r\n<p>Masalah pemasaran pada masyarakat-sentris\r\nhingga hari ini adalah, pemasaran yang memaksa.</p>\r\n\r\n<p>Maka beralihlah kepada cara\r\nberkomunitas karena :</p><p><br></p>\r\n\r\n<p><b>Biaya komunitas Kurang</b></p>\r\n\r\n<p>Beberapa merek terkuat di dunia\r\nawalnya dibangun melalui menggunakan pemasaran berbasis masyarakat yang murah.\r\nNike, Starbucks, Google ..dan lain-lain. </p>\r\n\r\n<p>Ketika perusahaan lain fokus dulu\r\npada pemenuhan "kebutuhan produk" masyarakat yang mereka layani, mereka tidak\r\nharus mengeluarkan uang besar untuk menarik pelanggan baru. </p>\r\n\r\n<p>Dan ketika mereka tinggal dekat\r\ndengan masyarakat, mereka tidak perlu riset pasar untuk mencari tahu apa yang\r\norang inginkan.</p>\r\n\r\n<p>Kiehl, misalnya, adalah pemasok\r\nproduk perawatan tubuh premium dicintai oleh model dan elit. Orang-orang dari\r\nseluruh dunia berziarah ke toko aslinya di New York. </p>\r\n\r\n<p>Dibandingkan dengan sebuah merek\r\nglobal yang terkenal sekarang dimiliki oleh L\'Oreal, kemasan Kiehl sangat\r\npolos, toko-toko mereka sangat biasa &nbsp;yang padahal sudah berdiri dari 1851 sampai\r\nhari ini, dan merek "Kiehl" tersebut tidak pernah diiklankan. </p>\r\n\r\n<p>"Sukses" telah diarahkan oleh\r\nproduk yang disesuaikan dengan kebutuhan pelanggan, promosi mulut-ke-mulut, seperti\r\ngratis di toko uji coba produk dan hubungan pribadi tanpa ditempa dari\r\nkebutuhan melibatkan komunitas masyarakat yang aktif dari setiap karyawannya.</p>\r\n\r\n<p>&nbsp;</p>\r\n<p><b>Komunitas Menumbuhkan Loyalitas</b></p>\r\n\r\n<p>Manusia diprogram untuk ingin\r\nhal-hal tertentu. Namun diatas dari semuanya adalah rasa memiliki dan perasaan\r\ningin dipahami.</p>\r\n\r\n<p>Kebutuhan ini paling sering\r\ndipenuhi melalui keluarga, klub dan komunitas.</p>\r\n\r\n<p>Ketika perusahaan mulai fokus\r\nuntuk membangun komunitas, semakin mendekatkan kepada yang sudah terbentuk atau\r\nmembantu untuk memulai, hal ini membuat dampak yang kuat yang menempa ikatan emosional.</p>\r\n\r\n<p>Ketika sebuah komunitas baru\r\ndidirikan, orang-orang yang pernah merasa ditinggalkan sekarang menemukan roh\r\nkekerabatan.</p>\r\n\r\n<p>Mereka mulai memiliki tempat\r\nuntuk disinggahi.</p>\r\n\r\n<p>Ketika sebuah komunitas yang ada\r\ndiperkuat, orang yang pernah merasa terpinggirkan sekarang menemukan pengakuan.</p>\r\n\r\n<p>Mereka menemukan bahwa mereka\r\nmemiliki peran penting untuk terlibat</p>\r\n\r\n<p>Nike telah melakukan pekerjaan\r\nyang menakjubkan dengan menjalin hubungan kepada segmen konsumen yang kurang\r\ndihargai dan membina masyarakat yang membangun pemberdayaan, dari basket dalam\r\nkota, untuk memberdayakan perempuan sebagai atlet. </p>\r\n\r\n<p>Imbas dari hal diatas adalah\r\nloyalitas pelanggan yang intens.</p><p><br></p>\r\n\r\n<p><b>Komunitas Menjaga Keaslian</b></p>\r\n\r\n<p>Komunitas Brand, tetap relevan,\r\nkarena mereka terus-menerus beradaptasi dengan perubahan kebutuhan, kepentingan\r\ndan nilai-nilai dari orang-orang yang memberi mereka berarti.</p>\r\n\r\n<p>Starbucks awalnya disediakan bagi\r\npenggemar sebuah pengalaman "theater kopi", dengan masing-masing\r\nnuansa yang penuh kepedulian.</p>\r\n\r\n<p>Dengan semakin banyaknya penggemar\r\nyang baru bergabung, barista dilatih,&nbsp;\r\nuntuk mendidik mereka &nbsp;tentang\r\nkopi eksotika, mengembangkan dimensi petualangan, dan dapat terakses dengan brand\r\nmereka. </p>\r\n\r\n<p>Ketika teknologi menyebabkan menjauhkan\r\njarak kerja dan kehidupan sosial, Starbucks menjadi "tempat ketiga" untuk\r\nmelarikan diri, "perlindungan", dan pengalihan.</p><p><br></p>\r\n\r\n<p><b>Komunitas Mengendalikan Inovasi</b></p>\r\n\r\n<p>Ada sumber yang lebih baik dari\r\npertumbuhan dan inovasi dari komunitas brand yang bergairah. Vans, awalnya\r\npembuat murah sepatu dek, diikuti kepentingan pelanggan berdedikasi untuk\r\nmemperluas ke sepatu kustom surfing, kompetisi surfing, sepatu skateboard dan\r\ngigi, taman skateboard, festival musik tur dan bahkan sebuah film. </p>\r\n\r\n<p>Dan dalam masing-masing bisnis,\r\nproduk baru, fitur dan cara pemasaran yang dihasilkan melalui aliran ide yang\r\nterus menerus.</p>\r\n\r\n<p>Komunitas Mendukung Reinvention\r\nAlam</p>\r\n\r\n<p>Dalam masa perubahan besar,\r\nbisnis harus sering menemukan kembali diri mereka untuk bertahan hidup. </p>\r\n\r\n<p>Belum lagi dorongan dari banyak\r\npihak untuk terus mainstream, menunggu trend pasar untuk berubah karena\r\nkhawatir tentang perubahan. </p>\r\n\r\n<p>Dua hal diatas, meningkatkan\r\nrisiko kegagalan dan melewatkan kesempatan dalam &nbsp;memberi energi kepada karyawan dan melampau\r\nkompetisi melalui perubahan yang berbasis masyarakat. </p>\r\n\r\n<p>Dengan melibatkan masyarakat\r\nyang-dimulai dengan pelanggan, namun juga untuk menyalurkan mitra, karyawan,\r\npemerintah, masyarakat dan investor-perusahaan dapat mengubah dirinya dengan\r\ncara yang organik daripada memilukan. </p>\r\n\r\n<p>Produk dan aktivitas yang tidak\r\nlagi dapat menciptakan dan memiliki nilai, akan dapat dilenyapkan, membebaskan\r\nsumber daya untuk inisiatif baru.</p>\r\n\r\n<p>Memfokuskan semua kegiatan dalam mendalami\r\npemahaman dalam memenuhi kebutuhan komunitas masyarakat yang terus berubah,\r\nterus melaukan monitoring sementara memupuk pertumbuhan baru untuk meletakkan\r\ndasar dalam ekspansi bisnis</p>\r\n\r\n<p>Lou Gerstner menciptakan kembali\r\nIBM untuk masuk ke pasar, tepatnya dengan cara ini.</p>\r\n\r\n<p>Di bawah tekanan untuk membongkar\r\norganisasi besar, Gerstner malah memprakarsai "Operasi Bear Hug," menugaskan\r\neksekutif di perusahaan, untuk menjangkau pelanggan mereka yang paling loyal\r\ndan menemukan tantangan yang paling mendesak mereka.</p>\r\n\r\n<p>Hal ini menyebabkan wawasan bahwa\r\nkekuatan nyata IBM adalah sebagai penyedia solusi terpadu-dan reinvention\r\nsebagai "e-bisnis" perusahaan.</p>\r\n\r\n<p>Dalam masa-masa sulit, lebih dari\r\nsebelumnya, orang mendambakan rasa dukungan masyarakat. Ketika perusahaan\r\nmenyediakan ini-dengan membangun masyarakat yang memberikan nilai nyata dan\r\nemosional, melalui karyawan dan pelanggan bekerja sama untuk memecahkan\r\ntantangan kolektif-mereka membangun ikatan abadi loyalitas dan menemukan\r\nsumber-sumber pertumbuhan baru. Pemasaran yang baik selalu menempatkan orang di\r\npusat. Cerdas pemasaran di masa-masa sulit keran kekuatan kolektif masyarakat.</p>\r\n\r\n<p>So mari berkomunitas, dalam\r\nmeningkatkan nilai brand yang berimbas pada peningkatan profit, bukan menjual produk untuk memaksa meningkatkan profit</p><br><p></p>\r\n', 'af46b-brand-community-ppt-presentation-1-728.jpg', 'umum', '', 1, 1, 0, 0, 1, '2015-07-20', '19:19:58'),
(33, '5 Tips Mempertahankan Brand', 'Tips, Mempertahankan, Brand, Merk, ', 'Tips Mempertahankan Brand Perusahaan Agar Tetap Exist Di Dunia Usaha Yang Penuh Dengan Persaingan Merk', '5 Tips Mempertahankan Brand', '<p><p>Membangun brand/merk pada masa saat ini, artinya lebih dari\r\nhanya sekedar menghabiskan uang untuk media massa dan iklan.</p>\r\n\r\n<p>Setiap perusahaan perlu memahami bahwa, membangun sebuah\r\nmerek pada masa sekarang, memerlukan strategi yang membuat brand tangguh dan\r\nelastis,&nbsp; salah satu yang harus\r\ndipertahankan dan dipersiapkan dengan baik, ketika krisis menyerang.</p>\r\n\r\n<p>Menggunakan media sosial yang dapat menghubungkan dunia,\r\nseperti yang kita tahu, informasi yang benar dan yang salah mengenai sebuah\r\nmerek dapat hilang dengan cepat.</p>\r\n\r\n<p>Bahkan merek yang terkuatpun dapat dilenyapkan dalam\r\nsekejap. Kemampuan perusahaan untuk mempertahankan diri dan melakukannya dengan\r\ncepat adalah komponen kunci dalam membangun brand yang kuat, kualitas, dan\r\nbrand yang tahan lama.</p>\r\n\r\n<p><b>Apa Yang Dimaksud\r\ndengan Mempertahankan Brand / Merk ?</b></p>\r\n\r\n<p>Mempertahankan brand adalah tindakan menjaga existensi\r\nsebuah barnd/merek dari serangan isu-isu yang datang. </p>\r\n\r\n<p>Yang dimaksud dengan serangan kepada brand adalah, segala\r\nsesuatu yang secara langsung mengancam nilai merek sehingga memecah kepercayaan\r\npelanggan yang telah terlibat merasa nyaman dengan sebuah merk.</p>\r\n\r\n<p>Sangat penting untuk dicatat bahwa serangan merek dapat\r\nterjadi di mana saja, kapan saja, dan oleh siapa saja, termasuk pelanggan yang\r\ntidak puas, perusahaan yang bersaing, dan bahkan karyawan. Serangan merek dapat\r\nmencakup:</p>\r\n\r\n<p><ul><li><span style="line-height: 1.45em; background-color: initial;">Seorang pegawai yang tidak puas dan melakukan\r\nblogging tentang keluhan mereka.</span></li><li><span style="line-height: 1.45em; background-color: initial;">Sebuah situs web pihak ketiga, yang memposting\r\nreview negatif dari produk atau jasa.</span></li><li><span style="line-height: 1.45em; background-color: initial;">Tim eksekutif perusahaan berperilaku buruk di\r\ndepan umum.</span></li><li><span style="line-height: 1.45em; background-color: initial;">Perubahan dalam kemasan produk yang imbasnya\r\nmenjadi umpan balik yang negatif pelanggan.</span></li><li><span style="line-height: 1.45em; background-color: initial;">Pesaing tidak etis yang menyebar informasi yang\r\nsalah tentang perusahaan.</span></li></ul></p>\r\n<p><b>Mengapa Mempertahankan Brand/Merek\r\nSangat Penting?</b></p>\r\n<p>Merek adalah fondasi dari bisnis. Orang percaya dalam apa yang mereka\r\nlihat, dengar, dan akhirnya \'merasa\' tentang merek, dan menghasilkan keputusan\r\npembelian dan loyalitas untuk kembali lagi.</p>\r\n<p>Selain itu, ketika kita memilih sebuah merek, sebagian besar adalah\r\ntentang menyatakan siapa kita, dan apa yang kita nilai dalam produknya.</p>\r\n<p>Kita memilih untuk bangga dan memperlihatkan pilihan kita dengan\r\nbangga. Merek yang kita pilih menggunakan bahan yang tepat, yang dibeli dari\r\npemasok yang tepat, dan diproduksi oleh karyawan yang tepat, dengan cara yang\r\nbenar.</p>\r\n<p>Kita percaya bahwa mereka (pemilik brand) memberikan kualitas, tetapi kita\r\njuga percaya segala sesuatu yang mereka bawa. </p>\r\n<p>Namun, apa yang terjadi jika kepercayaan yang rusak? Pentingnya\r\nkepercayaan dari sebuah merek, berarti bahwa menjaga setiap rasa yang kita rasakan\r\ndari sebuah merek, dan merusknya dapat berakibat fatal.</p>\r\n<p><b>5 Tips Untuk Mempertahankan\r\nBrand/Merk</b></p>\r\n<p>Karena pertahanan merek adalah komponen utama untuk membangun, merek\r\ntangguh dan kuat, ada 5 tips berikut untuk mempertahankan merek yang lebih\r\nbaik.</p>\r\n<p>Strategi ini dapat diterapkan untuk inisiatif merek saat ini perusahaan\r\nAnda, serta sendiri upaya personal branding Anda.</p>\r\n<p><b>Mengelola Pertahanan Merk Secara\r\nTerprogram</b></p>\r\n\r\n<p>Mengelola program pertahanan merk/brand hanya dengan mengakui atau\r\nmengetahui dengan pasrah, bahwa â€œserangan merk itu adaâ€, bukanlah strategi\r\ndefensif. </p>\r\n<p>Sebaliknya, perusahaan perlu untuk mengelola pertahanan merek, secara\r\nterporgram dengan mem fokuskan pada penilaian risiko serangan merek dan\r\nmengembangkan strategi defensif yang formal.</p>\r\n</p><blockquote style="margin: 0 0 0 40px; border: none; padding: 0px;"><p><p><b style="font-style: normal;">Menilai Resiko Merek</b></p></p><p><p><span style="font-style: normal;">Menilai risiko\r\nmerek adalah proses mengidentifikasi ancaman atau serangan potensial yang\r\nmungkin dihadapi.</span></p></p><p><p><span style="font-style: normal;">Sebagai contoh\r\nseperti diatas jelas menunjukkan, kerusakan merek bisa apa saja, besar atau\r\nkecil, dan datang dari mana saja, termasuk dari dalam.</span></p></p><p><p><span style="font-style: normal;">Ketika merencanakan\r\nuntuk sesuatu yang belum diketahui sering sekali sangan sulit untuk dilakukan,\r\npemikiran dan intuisi tentang yang didepan, sangat penting ketika mengembangkan\r\nmerek yang tangguh. </span></p></p><p><p><span style="font-style: normal;">Artinya sangatlah\r\npenting jika perusahaan terus menyelenggarakan sesi brainstorming rutin, untuk\r\nmengidentifikasi risiko merek secara umum.</span></p></p><p><p><b style="font-style: normal;">Mengembangkan Sebuah Strategi Pertahana\r\nMerk Yang Formal </b></p></p><p><p><span style="font-style: normal;">Sebuah strategi\r\nformal pertahanan merek adalah langkah-demi-langkah serta panduan untuk\r\nbagaimana mempertahankan perusahaan anda terhadap serangan tertentu.</span></p></p><p><p><span style="font-style: normal;">Sangatlah penting\r\nbahwa setiap risiko merek diberikan perencanaan tindakan yang unik dan\r\nterperinci. </span></p></p><p><p><span style="font-style: normal;">Dalam setiap\r\nstrategi, perusahaan harus menguraikan tugas-tugas yang terkait dengan hal\r\ntindakan mempertahankan merek, serta menandai nama-nama karyawan yang terlibat\r\ndan berperan khusus dengan tanggung jawabnya.</span></p></p><p><p><span style="font-style: normal;">Idenya adalah untuk\r\nmemiliki segalanya siap untuk beraksi ketika serangan terjadi, sehingga\r\nperusahaan dapat bergerak dengan mudah ke modus pertahanan</span>.</p></p></blockquote><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p><b>Jangan Lihat Mempertahankan Merk\r\nhanya pada Masalah Media Sosial Saja.</b></p>\r\n<p>Pertahanan merek bukan hanya tentang mengelola dampak negatif dari\r\nmedia sosial. Ya, media sosial mungkin memainkan peran utama dalam operasi\r\npertahanan merek perusahaan, tetapi penyerang yang tangguh dan akan datang untuk\r\nsebuah perusahaan, dari berbagai arah.</p>\r\n<p>Perusahaan yang memusatkan semua pertahanan mereka di media sosial pada\r\nakhirnya akan tertinggal tanpa persiapan, menghadapi berbagai serangan dari merek\r\nlain, seperti dari media digital lain, media cetak, dan chatting online.</p>\r\n<p>Keragaman dan variasi adalah hal yang sangat penting ketika bermain dalam\r\nmempertahankan merek.</p>\r\n<p><b>Sistem Penyebaran Peringatan\r\nDini untuk Memantau Serangan Merek</b></p>\r\n<p>Sistem peringatan dini adalah metode untuk mendeteksi serangan merek secara\r\nlangsugn, sehingga perusahaan dapat merespon dengan cepat dan membatasi jumlah\r\nkerusakan yang disebabkan oleh setiap serangan. Pemberitahuan dari serangan\r\nbisa datang dalam berbagai bentuk.</p>\r\n<p>Tiga hal yang paling umum adalah aplikasi online monitoring, keluhan\r\npelanggan langsung, dan testimonial karyawan.</p>\r\n<p>Terlepas dari bagaimana perusahaan diberitahu tentang serangan, semua\r\npemberitahuan harus dianggap serius dan ditangani dengan segera.</p>\r\n<p>Selanjutnya, sistem peringatan dini ini, pasti akan terjadi keunikan\r\nuntuk setiap perusahaan. Namun, sangatlah disarankan kepada perusahaan, untuk melibatkan\r\nkaryawan dan pelanggan dalam metode deteksi dini dari mereka.</p>\r\n<p>Beri mereka alat-alat (seperti aplikasi Discoin kepada pelanggan) dan\r\nsumber daya lain untuk melaporkan serangan, dan saya pikir Anda akan terkejut\r\nseberapa efektif mereka dapat.</p>\r\n<p><b>Asumsikan Serangan Merek Itu,\r\nBesok Akan Berbeda</b></p>\r\n<p>Pertahanan merek adalah permainan terbaik yang dimainkan oleh\r\nperusahaan-perusahaan yang mampu belajar dan beradaptasi. Sebagai perusahaan,\r\nwalaupun belajar untuk mempertahankan merk terhadap serangan tertentu,\r\npenyerang juga akan beradaptasi dan meluncurkan serangan merek yang sama sekali\r\nberbeda, dan tidak diragukan lagi menggunakan lebih baru, lebih cepat dengan bentuk\r\nteknologi yang tersedia.</p>\r\n<p>Pertempuran dengan cara ini akan berlanjut selamanya. Oleh karena itu,\r\npenting bahwa merek anda menjadi tangguh melalui adaptasi terus menerus untuk\r\nwaktu dan teknologi.</p>\r\n<p><b>Jangan Biarkan Pertahanan Merk Menjadi\r\npekerjaan Rumah Yang Lain bagi Karyawan </b></p>\r\n<p>Pertahanan merek bukanlah pekerjaan rumah bagi karyawan anda. Setiap\r\norang dalam perusahaan harus ditugaskan, bukan memikirkan mempertahankan merek,\r\ndan berperan dalam membangun dan melestarikan nilai merek perusahaan tersebut.</p>\r\n<p>Eksekutiflah yang harus memimpin jalan dengan berkomunikasi tentang tantangan\r\nmempertahankan merek, tujuan, dan strategi pertahanan untuk karyawan, dan\r\nmendorong partisipasi mereka. </p>\r\n<p>Selain itu, sangat disarankan, kepada perusahaan untuk mendedikasikan\r\nseluruh panitia untuk proses membangun merek.</p>\r\n<p>Brand Manajer ini akan bertanggung jawab untuk mengevaluasi risiko,\r\nmengembangkan strategi pertahanan, membela terhadap serangan, dan menanamkan\r\nbrand intelijen di seluruh organisasi. "Salah satu merek, satu tim",\r\ndan ini adalah pola pikir perusahan bermerek tangguh.</p>\r\n<p><b>Penutupan ...</b></p>\r\n<p>Tidak dapat disangkal bahwa membangun brand tangguh akan memakan waktu,\r\nuang, dan banyak usaha. </p>\r\n<p>Namun, hal tersebut benar-benar penting, jika Anda melakukan segala\r\nupaya untuk mempertahankan merek anda dan berperilaku seolah-olah reputasi anda\r\nadalah uang, Anda akan dibayar oleh izin pelanggan anda, untuk membangun hal\r\nyang paling berharga dari aset - merek Anda â€“ jangka panjang, jangka panjang,\r\nuntuk ke masa depan.</p></p>', 'f5dea-personal-branding-by-theavinashmishra.jpg', 'umum', '', 1, 1, 0, 0, 1, '2015-07-22', '11:37:46'),
(34, 'Menyusun Strategi Pemasaran Digital Yang Lebih Baik, Dengan 4 Tips', 'Strategi, Pemasaran, Digital, Branding, Tips', 'Strategi Pemasaran Digital Dan Strategi Branding Digital Terdapat Perbedaan Yang Sangat Signifikan, Antara Menjual Produk Dan Menjual Brand.', 'Menyusun Strategi Pemasaran Digital Yang Lebih Baik, Dengan 4 Tips', '<p></p><p><span style="line-height: 1.45em; background-color: initial;">Strategi ini membutuhkan fokus dan sumber daya yang banyak untuk\r\nmelakukannya dengan benar. Jika Anda ingin melangkah maju, namun, pertimbangkan\r\nhal-hal sederhana yang dapat Anda lakukan untuk meningkatkan strategi digital\r\nAnda sekarang.</span><br></p>\r\n\r\n<p><b>1.&nbsp;\r\n</b><b>Fokus\r\npada Mobile</b></p>\r\n\r\n<p>Hal ini seharusnya sudah menjadi rahasia umum saat ini, tapi banyak\r\npengusaha masih terfokus pada membuat website yang keren, namun gagal untuk\r\nmemberikan sensasi pengalaman yang baik melalui mobile. </p>\r\n<p>Dengan mayoritas mata yang melihat dan menggunakan perangkat mobile, Anda\r\nakan â€œmenyakiti perasaanâ€ merek anda, jika anda tidak memberikan pengalaman\r\nmelalui aplikasi mobile yang <i>user-friendly</i>\r\nkepada konsumen anda.</p>\r\n<p>Hal ini juga layak menjadi tujuan, karena Google baru-baru ini merilis\r\nalgoritma pencarian baru pada tanggal 22 April lalu, tetang perangkingan\r\nperingkat website mobile yanv user friendly, memilki nilai yang lebih tinggi\r\ndalam pencarian. </p>\r\n<p><b>2.&nbsp;\r\n</b><b>Berhenti\r\nmengganggu pelanggan Anda.</b></p>\r\n\r\n<p>Konsumen dibanjiri dengan konten, dan rentang perhatian mereka menjadi\r\nsemakin pendek dan lebih cepat berubah.</p>\r\n<p>Jika Anda ingin menarik dan mempertahankan pelanggan, jagalah&nbsp; keterlibatan anda se-sederhana mungkin dan\r\nmemastikan bahwa hal itu akan menambah nilai bagi brand anda.</p>\r\n<p>Lebih baik lagi, memantau apa yang pelanggan Anda lakukan dan bicarakan\r\ndan dapat berada di sana, untuk terlibat dengan mereka.</p>\r\n<p><b>3.&nbsp;\r\n</b><b>Mengajak\r\npelanggan untuk terlibat dengan cara yang mudah dan jelas</b></p>\r\n\r\n<p>Saat anda memberikan informasi / mempromosikan produk, pengunjung anda\r\nseharusnya segera melihat dan memahami apa yang anda harapkan dari mereka.</p>\r\n<p>Mudah-mudahan, anda telah menyelesaikan riset anda, karena lembaran riset\r\nanda, akan tahu apa yang konsumen anda harapkan yang menampilkan laporan dari\r\npengalaman konsumen&nbsp; anda terima.</p>\r\n<p>Juga, setiap â€œpanggilan untuk bertindak / Call To Actâ€ haruslah&nbsp; sangat mudah untuk ditemukan dengan data\r\ninformasi yang lengkap.</p>\r\n<p>Sekali lagi, jika anda menjual produk, pengalaman / proses yang bebankan\r\nkepada konsumen anda haruslah mudah.</p>\r\n<p>Sebagai pemula, pertimbangkan untuk menggunakan plug-in media sosial yang\r\nmemungkinkan pengunjung untuk login melalui Twitter, Facebook, Google+ atau\r\nmedia sosial lainnya, daripada membuat akun yang sama sekali baru.</p>\r\n<p><b>4.&nbsp;\r\n</b><b>Tetap\r\npada pengalaman menggunakan website</b></p>\r\n\r\n<p>Merk disarankan untuk memanfaatkan\r\nplatform teknologi yang sudah ada, seperti Instagram dan Twitter, di mana\r\npelanggan anda sudah terlibat secara teratur. </p>\r\n\r\n<p>Dan buatlah proses atau alur yang\r\nsangat-sangat mudah untuk menemukan anda di media sosial dengan menambahkan icon\r\ndan link yang mudah untuk ditemukan di situs Anda.</p>\r\n\r\n<p>Tentu saja, strategi digital yang\r\nefektif membutuhkan waktu dan usaha, dan pengusaha harus jelas mendefinisikan\r\ntujuan mereka sebelum meluncurkan salah satu. </p>\r\n\r\n<p>Melakukan hal itu sendiri sangat\r\nsulit, terutama jika Anda tidak berpengalaman atau tidak yakin tentang apa yang\r\nharus dilakukan.</p>\r\n\r\n<p>"Pada akhirnya, bagaimanapun\r\njuga, sebagai perusahaan yang tumbuh dan menambah keseriusan tentang pemasaran\r\ndigital dan yang lebih terfokus pada membangun merek, adalah perusahaan memimpin\r\nsebuah generasi dan keteikatan pelanggan," katanya, "</p>\r\n\r\n<p>Bermitra dengan desainer dan\r\npengembang dengan keahlian khusus yang dapat melihat jauh melampaui teknologi\r\ndigital sederhana saat ini, dan buat jangka panjang dan lebih terfokus pada\r\nstrategi menciptakan pengalaman yang luar biasa bagi pelanggan anda, terbukti\r\nmenjadi hal yang layak untuk menjadi investasi. "</p><br><p></p>', '1f129-digital-marketing-hp.jpg', 'umum', '', 1, 1, 0, 0, 1, '2015-07-23', '17:51:26'),
(35, 'Siapa Target Jenis Konsumen Yang Menjadi Prioritas ?', 'Jenis, Tipe, Konsumen, Pembeli, Pelanggan,member Loyal, ', 'Sebelum Berkonsentrasi Pada Pemasaran Anda, Tentukan Prioritas Jenis Konusumen Yang Anda Inginkan Untuk Mempertahankan Brand Bisnis Anda, Sapakah Pembeli, Pelanggan Atau Member Loyal', 'Siapa Target Jenis Konsumen Yang Menjadi Prioritas ?', '<p><p>Dalam setiap usaha, kita semua\r\nmengetahui bahwa, sumber profit dan keuntungan adalah konsumen, bukan uang\r\ndatang dari langit bukan ?</p><p><span style="line-height: 1.45em; background-color: initial;">Maka dari itu, setiap usaha pasti\r\nmelakukan pemasaran dan promosi untuk mengumpulkan konsumen sebanyak-banyaknya.</span></p>\r\n\r\n<p>Lalu, apa prioritas yang anda\r\nlakukan untuk mengumpulkan konsumen sebanyak-banyaknya itu ? </p>\r\n\r\n<p>Sebelum anda mengetahui prioritas\r\nanda, coba kita mendefenisikan konsumen yang menjadi target anda, jenis apa\r\nsaja konsumen itu.</p>\r\n\r\n<p>1.&nbsp; Pembeli</p>\r\n\r\n<p>2.&nbsp; Pelanggan</p>\r\n\r\n<p>3.&nbsp; Member\r\nLoyal.</p>\r\n\r\n<p><b>Pembeli</b> adalah, seorang konsumen yang baru pertama kali membeli\r\nkarena penasaran atau karena rekomendasi dari orang terdekatnya, atau bahkan\r\nmembeli karena melihat keramaian yang datang ke tempat usaha anda.</p>\r\n\r\n<p><b>Pelanggan</b> adalah, seorang konsumen yang sering membeli produk anda,\r\nwalaupun pelanggan anda tersebut &nbsp;juga\r\nsering membeli produk dari kompetitor anda, yang mungkin karena dipengaruhi\r\nkarena jarak tempat usaha terdekat dan waktu perjalanan tercepat.</p>\r\n\r\n<p><b>Member loyal</b> adalah, seorang konsumen yang sering membeli dan\r\nmengakui bahwa dirinya adalah seorang pelanggan yang rela memiliki identitas\r\ndari brand bisnis anda, bahkan jika harus mengeluarkan beberapa rupiah, untuk\r\nmemilikinya. &nbsp;</p>\r\n\r\n<p>Jadi, yang manakah prioritas target\r\nkonsumen anda ? ada 3 solusi yang saya anggap memiliki level solusi tertinggi\r\ndi bidangnya.</p>\r\n\r\n<p>Jika anda memilih <b>Pembeli</b>, anda bisa menggunakan website\r\nanda atau mengunakan layanan&nbsp; mall\r\nonline, atau jual beli online, yang tersebar di internet.</p>\r\n\r\n<p>Jika anda memilih <b>Pelanggan</b>, anda bisa menggaji <i>Quality Control</i>, <i>Decoration Consultant </i>dan Chef Profesional</p>\r\n\r\n<p>Jika anda memilih <b>Member Loyal</b>, anda hanya membutuhkan kartu\r\nmember digital / aplikasi Discoin dari sempoa, dan bersosialisasi di komunitas\r\nbrand di website sempoa.biz.</p><br></p>', '33f6c-WhatValueData-Image.jpg', 'umum', '', 1, 1, 0, 0, 1, '2015-07-24', '21:06:48'),
(36, 'Mengapa Wajib Beralih Ke Pemasaran Digital', 'Pemasaran, Digital,usaha, Perusahaan, Hancur,', 'CEO CISCO Dalam Pidatonya Memprediksi 40% Bisnis Usaha Besar Yang Belum Beralih Dan Berkonsentrasu Pada Pemasaran Digital Akan Hancur', 'Mengapa Wajib Beralih Ke Pemasaran Digital', '<p><p>Dunia dengan cepat berevolusi menjadi era digital. Karena\r\norang-orang mengkonsumsi konten digital setiap hari. </p>\r\n\r\n<p>Seperti dikutip dari pidato CEO CISCO John Chamber, di San\r\nDiego, dalam pembahasannya, ia fokus pada masa depan dan apa yang perusahaan-perusahaan\r\nlakukan untuk selanjutnya. </p>\r\n\r\n<p>Dan ia juga menyatakan, dalam sepuluh tahun kedepan,\r\ndiperkirakan bahwa 40% yang belum beralih ke era digital akan segera hilang.</p>\r\n\r\n<p>Chambers menunjuk empat alasan. Perusahaan yang gagal: </p>\r\n\r\n<p>1.&nbsp;\r\nTerlambat dalam Transisi cara pemasaran</p>\r\n\r\n<p>2.&nbsp;\r\nMelakukan "hal yang benar" terlalu\r\nlama</p>\r\n\r\n<p>3.&nbsp;\r\nTidak menemukan kembali diri mereka sendiri</p>\r\n\r\n<p>4.&nbsp;\r\nTerlalu jauh dari pelanggan mereka</p>\r\n\r\n<p>Jadi apa sarannya? Kembali pada pilihan mereka yang\r\nmengelola perusahaan, Mengganggu atau terganggu ?</p>\r\n\r\n<p>Memiliki kemampuan untuk membuat perubahan dan menang di era\r\ninformasi sekarang, tidak berarti Anda akan menang di era digital. </p>\r\n\r\n<p>Faktanya, sementara 87% dari eksekutif berpikir untuk\r\nberalih ke cara digital itu adalah sangat penting, namun hanya 7% benar-benar\r\nmemiliki strategi digital. </p>\r\n\r\n<p>Berikutnya: 75% dari bisnis akan menjadi sepenuhnya digital\r\npada tahun 2020, tetapi hanya 30% dari mereka akan berhasil, tapi itu bukan\r\nprediksi tentang terjadinya hari kiamat. </p>\r\n\r\n<p>Chambers berfokus pada apa yang perusahaan lakukan untuk berhasil.\r\nBerinovasi, menemukan kembali. Transformasi,mengeksekusi dan memprioritaskan.\r\nMemanfaatkan titik infleksi. Pikirkan secara eksponensial.</p>\r\n\r\n<p>Dikutip dari : <a href="http://blogs.cisco.com/collaboration/clus-monday-wrap#more-171333">http://blogs.cisco.com/collaboration/clus-monday-wrap#more-171333</a>\r\n</p>\r\n\r\n<p>Sebagian besar budaya dan kepemimpinan seperti diatas adalah\r\nselalu tentang teknologi, di sisi teknologi adalah tentang arsitektur yang lebih\r\ndari hanya sekedar produk individu. </p>\r\n\r\n<p><b>Jadi, mengapa pemasaran\r\ndigital?</b></p>\r\n\r\n<p>Pertama-tama, pemasaran digital adalah jauh lebih terjangkau\r\ndaripada metode pemasaran tradisional offline. Email atau media sosial\r\nkampanye, misalnya, dapat mengirimkan pesan pemasaran kepada konsumen untuk\r\nfraksi sedikit saja dari biaya kampanye iklan TV atau cetak, dan berpotensi\r\nmenjangkau khalayak yang lebih luas.</p>\r\n\r\n<p>Tapi salah satu manfaat utama melakukan pemasaran Anda\r\nsecara digital adalah kemudahan yang hasilnya dapat dilacak dan dimonitor.\r\nDaripada melakukan penelitian perilaku pelanggan yang mahal, Anda dapat dengan\r\ncepat melihat tarif respon pelanggan dan mengukur keberhasilan kampanye\r\npemasaran Anda secara real-time, memungkinkan Anda untuk merencanakan lebih\r\nefektif untuk yang berikutnya.</p><br></p>', '56347-Digital-Marketing-Trends.jpg', 'umum', '', 1, 1, 0, 0, 1, '2015-07-31', '14:13:38'),
(37, '', '', '', 'Maju Bersama Ekonomi Digital, Mengapa Tidak?', '<p>\r\n\r\n<p>Apa itu Ekonomi Digital? Sebelumnya simak <a href="http://wearesocial.sg/blog/2015/08/global-statshot-august-2015/">data</a>\r\nberikut ini. Penggunaan internet global mencapai 3,1 milliar pengguna dari 7,3\r\nmilliar penduduk dunia atau hampir 43% sudah melek internet. Sementara di <a href="http://inet.detik.com/read/2015/03/26/132012/2870293/398/pengguna-internet-indonesia-tembus-881-juta">Indonesia</a>\r\npenggunaan internet mencapai 88,1 juta jiwa dari 252 juta jumlah penduduk ditahun\r\n2014, dengan dominasi pengguna seluler sebesar 85%. Artinya penggunaan selular\r\nsebagai sarana internet sangat kuat dan akan terus berkembang dari tahun ke\r\ntahun. Ini adalah kesempatan yang bagus bagi pelaku <i>â€œekonomi digitalâ€.</i></p>\r\n\r\n<p><b>Pengertian Ekonomi Digital</b></p>\r\n\r\n<p>Konsep ekonomi digital pertama kali diperkenalkan <a href="http://dontapscott.com/books/the-digital-economy/">Tapscott</a> (1997),bisa\r\ndikatakan sebuah era ekonomi yang berbasis digital (baik itu informasi, instrumen,\r\nakses serta pemrosesan) dikarenakan dampak penggunaan internet. Ini berarti\r\ninternet telah merubah sektor ekonomi melalui\r\nteknologi digital.</p>\r\n\r\n<p><b>Mengapa memilih ekonomi digital?</b></p>\r\n\r\n<p>Bagi para pelaku bisnis terutama sektor usaha kecil dan menengah\r\nbaik secara individu ataupun badan usaha merupakan satu langkah maju ketika kegiatan\r\nekonomi (jual-beli serta pemasaran tentunya) dapat dilakukan secara digital melalui\r\ninternet. Contohnya banyak munculnya â€˜<i>eCommerceâ€™ </i>(perusahaan berbasis teknologi) serta berjamurnya\r\nâ€˜<i>marketplaceâ€™</i> (pasar digital dimana seseorang dengan mudah menjual\r\nproduk mereka secara online, dan bertransaksi dengan pembeli). </p>\r\n\r\n<p><b>Bagaimana ekonomi digital bekerja?</b></p>\r\n\r\nKembali ke Tapscott, memberikan\r\n12 karakteristik ekonomi digital yang dirangkum dalam infografis berikut ini.</p><p><p><img src="/sempoa.biz/files/images/posts/eca2ed022374e6ceb3fbb4c566210540.jpg"></p></p><p>\r\n\r\n<p><b><a href="http://www.sempoa.biz/">Sempoa.biz</a> sebagai\r\njembatan menuju Ekonomi Digital</b></p>\r\n\r\nDengan semakin\r\nbanyaknya perusahaan baru maupun yang lama, berbasis <i>â€˜eCommerseâ€™</i>\r\nmenyebabkan terjadi persaingan yang semakin ketat, untuk dapat bertahan dan\r\nmemenangkan persaingan, para pelaku ekonomi digital perlu memahami\r\nkarakteristik dan konsep ekonomi digital yang berbeda dengan ekonomi klasik\r\nyang selama ini dikenal. Sempoa dikenal sebagai <i>â€œeCommerse App Builderâ€</i> adalah\r\nsebuah perusahaan yang membantu para pelaku ekonomi digital terutama <i>â€˜eCommerseâ€™\r\n</i>dalam membangun Aplikasi Anda sendiri. Dengan memperhatikan segala aspek\r\nyang tedapat pada â€œkarakeristik ekonomi digitalâ€.<br></p>', '5a834-infografis ekonomi digital by sempoa.png', 'umum', '', 37, 36, 0, 0, 0, '2015-12-06', '11:21:55');
