(771, 1, 61, 155, 0, 'JJGRQ-09', 'Punuk / Blade', '1', 'Daging sapi bagian atas yang menyambung dari bagian daging paha depan terus sampai ke bagian punuk sapi. Pada bagian tengahnya terdapat serat-serat kasar yang mengarah ke bagian bawah, yang cocok jika digunakan dengan cara memasak dengan teknik mengukus. Biasanya daging ini digunakan untuk membuat makanan khas Nusa Tenggara Timur yaitu Seâ€™i (sejenis daging asap).&#13;&#10;Penggunaan: empal, semur, sop, kari, abon dan rendang.', '86000', '', 74, '', 1, '2015-08-28', '01:17:08'),
(772, 1, 61, 155, 0, 'JJGRQ-08', 'Penutup / Top Side', '1', 'Bagian daging sapi yang terletak di bagian paha belakang sapi dan sudah mendekati area pantat sapi. Potongan daging sapi di bagian ini sangat tipis dan kurang lebih sangat liat. Selain itu bagian ini sangat kurang lemak sehingga jika dibakar atau dipanggang akan sangat lama melunakkannya. Biasanya daging ini digunakan untuk campuran daging pizza.&#13;&#10;Penggunaan: bistik, empal, rendang, dendeng, baso, abon.', '105000', '', 74, '', 1, '2015-07-04', '13:43:08'),
(773, 1, 61, 155, 0, 'JJGRQ-07', 'Lamusir / Cube Roll', '1', 'Bagian daging sapi yang berasal dari bagian belakang sapi di sekitar has dalam, has luar dan tanjung. Potongan daging ini diambil dari bagian punggung, dipotong dari rusuk keempat sampai rusuk keduabelas. Lamosir termasuk daging yang lunak karena didalamnya terdapat butir-butir lemak. Daging lamosir dapat dipanggang dalam oven, dibakar atau digrill. Biasanya daging ini digunakan untuk makanan khas Batam, Sup Lamosir.&#13;&#10;Penggunaan: bistik, sate, rendang, empal, sukiyaki.', '95000', '', 74, '', 1, '2015-08-28', '01:16:45'),
(774, 1, 61, 155, 0, 'JJGRQ-06', 'Tanjung / Rump', '1', 'Salah satu bagian daging sapi yang berasal dari bagian punggung belakang. Biasanya daging ini disajikan dengan dipanggang.&#13;&#10;Penggunaan: bistik, empal, rendang, dendeng, baso, abon.', '105000', '', 74, '', 2, '2015-08-28', '01:16:22'),
(775, 1, 61, 155, 0, 'JJGRQ-05', 'Has Luar / Sirloin', '1', 'Bagian daging sapi yang berasal dari bagian bawah daging iga, terus sampai ke bagian sisi luar has dalam. Daging ini adalah daging yang paling murah dari semua jenis has, karena otot sapi pada bagian ini masih lumayan keras dibanding bagian has yang lain karena otot-otot di sekitar daging ini paling banyak digunakan untuk bekerja. Biasanya daging ini digunakan untuk membuat steak.&#13;&#10;Penggunaan: bistik, roll.', '105000', '', 74, '', 2, '2015-07-04', '13:43:08'),
(776, 1, 61, 155, 0, 'JJGRQ-04', 'Has Dalam / Tenderloin', '1', 'Daging sapi dari bagian tengah badan. Sesuai dengan karakteristik daging has, daging ini terdiri dari bagian-bagian otot utama di sekitar bagian tulang belakang, dan kurang lebih di antara bahu dan tulang panggul. Daerah ini adalah bagian yang paling lunak, karena otot-otot di bagian ini jarang dipakai untuk beraktivitas. Biasanya bagian daging ini digunakan untuk membuat steak.&#13;&#10;Penggunaan: grill, steak, sate, sukiyaki.', '135000', '', 74, '', 2, '2015-12-03', '06:28:14'),
(778, 1, 61, 155, 0, 'JJGRQ-02', 'Back Rib', '1', 'Daging Iga Sapi atau rib adalah bagian daging sapi yang berasal dari daging di sekitar tulang iga atau tulang rusuk. Bagian ini termasuk dari delapan bagian utama daging sapi yang biasa dikonsumsi. Seluruh bagian daging iga ini bisa terdiri dari beberapa iga, mulai dari iga ke 6 sampai dengan iga ke- 12; untuk potongan daging iga yang akan dikonsumsi bisa terdiri dari 2 sampai dengan 7 tulang iga.&#13;&#10;&#13;&#10;Tulang iga, atau short ribs, biasa diolah menjadi sop seperti sop konro. Bisa juga dimasak semur, dipanggang.&#13;&#10;&#13;&#10;Rib-eye steak adalah potongan dalam bentuk steak, bisa dengan tulang (bone in) atau tanpa tulang (boneless). Biasanya bagian ini digunakan sebagai bahan dasar makanan khas Makassar, sup konro.', '68000', '', 74, '', 1, '2015-08-28', '01:14:56'),
(781, 1, 61, 155, 0, 'OKRYL-05', 'Kelapa / Knuckle', '1', 'Kelapa atau yang lebih dikenal dengan nama inside / knuckle adalah bagian daging sapi yang berasal dari paha belakang bagian atas yang berada di antara penutup dan gandik. Biasanya hidangan yang menggunakan daging ini adalah panggangan dan casserole.&#13;&#10;Penggunaan: cornet, sate, daging giling, sop, rawon.', '105000', '', 74, '', 1, '2015-07-04', '13:48:54'),
(782, 1, 61, 155, 0, 'OKRYL-04', 'Gandik / Silverside', '1', 'Bagian paha belakang sapi terluar dan paling dasar. Banyak yang sering tertukar dengan menyamakannya dengan Daging Paha Depan atau Shank. Biasanya daging ini digunakan untuk membuat dendeng balado atau abon sapi.&#13;&#10;Penggunaan: bistik, rendang, empal, dendeng, baso, abon.', '105000', '', 74, '', 1, '2015-08-28', '01:13:34'),
(783, 1, 61, 156, 0, 'OKRYL-03', 'Sengkel / Shank', '1', 'Sengkel berasal dari bahasa Belanda, schenkel, berasal dari bagian depan atas kaki sapi. Biasanya digunakan sebagai bahan dasar sup, soto dan bakso urat.&#13;&#10;Penggunaan: semur, sop, rawon, empal.', '95000', '', 74, '', 1, '2015-08-28', '01:12:56'),
(786, 1, 61, 155, 0, 'QCXMC-01', 'Buntut Ring', '1', 'Kandungan vitamin yang terdapat di buntut sapi ternyata besar juga,&#13;&#10;Mengobati dan / atau mencegah kekurangan zat besi. Tanpa daging dalam diet, sulit bagi wanita dewasa untuk memenuhi kebutuhan zat besi tanpa suplemen.', '87000', '', 74, '', 2, '2015-08-28', '01:12:31'),
