(814, 1, 61, 161, 0, 'SYSVX-06', 'Sayap Ayam', '1', 'Memiliki kadar lemak dan protein lebih tinggi dari daging paha ayam, lebih banyak kulit dibandingkan daging dan paling cocok untuk masak kuah atau digoreng.', '26000', '', 74, '440ff', 0, '2015-12-03', '06:19:55'),
(816, 1, 61, 161, 0, 'SYSVX-04', 'Paha Bawah Ayam', '1', 'Merupakan salah satu bagian daging ayam yang banyak diminati karena kontur dagingnya yang empuk dan rasanya lezat, namun memiliki kadar lemak yang lebih tinggi dari daging dada ayam.', '36000', '', 74, '440ff', 0, '2015-12-03', '06:20:19'),
