(819, 1, 61, 161, 0, 'SYSVX-01', 'Ceker Ayam', '1', 'Kaya akan protein dan zat besi, biasanya dijadikan bahan kuah sop atau makanan ringan seperti keripik dan dapat menguatkan badan.', '20000', '', 74, '440ff', 0, '2015-12-03', '06:22:19'),
