(21, 'statis', 'top', 2, 1, 'Fitur Aplikasi Discoin', 'Aplikasi Discoin - Kartu Member / Pelanggan Digital', 'Mobile Apps, Aplikasi Mobile, Kartu Pelanggan Digital, Kartu Member Digital, Kartu Anggotal Digital', 'Aplikasi Telephone Seluler sebagai alat branding usaha anda, yang berfungsi sebagai kartu pelanggan digital atau kartu member digital untuk mengikat pelanggan', '<p>\r\n    <div class="row-fluid">\r\n    	<div class="span2">\r\n            <img src="http://sempoa.biz/files/images/discoin_coin_2.png" style="width:100%;"/>\r\n        </div>\r\n        <div class="span10" style="text-align:justify" >\r\n        <b>Aplikasi Discoin</b> adalah sebuah personal aplikasi mobile (gratis) yang di rancang untuk brand bisnis anda, mengunakan icon aplikasi dari logo brand bisni anda, sebagai aplikasi identitas member loyal / kartu member digital brand bisnis anda,untuk mengikat member loyal anda, yang kaya dengan fitur / layanan marketing dan branding digital&nbsp;, yang juga dapat menjadi penghubung antara member loyal anda dengan komunitas brand dimana brand bisnis anda bergabung, agar member loyal anda dapat dilayani dengan layanan diskon belanja setiap hari, baik belanja secara online, maupun offline (langsung datang) </a> \r\n       </div> \r\n    </div>\r\n    <br>\r\n        </p><h2>Fitur Layanan Aplikasi Discoin</h2>\r\n      Dibawah ini adalah contoh aplikasi kartu pelanggan digital usaha anda atau juga digunakan untuk program membership dengan kartu member digital ini, aplikasi ini disebut aplikasi Discoin, yang dirancangkan khusus untuk badan usaha anda gratis, agar anda dapat memancing pembelian dan mengikat konsumen anda dan di konversi menjadi pelanggan atau member usaha anda.<br><br>\r\n      <div style="text-align:justify">\r\n        <table class="blocking" width="100%">\r\n            <tbody><tr>\r\n                <td style="width:40%; text-align:justify" valign="top">\r\n                <img src="http://sempoa.biz/files/images/discoin_icon_2.png" style="width:98%; "></td>\r\n                <td valign="top">\r\n                <h2>Custom Icon Aplikasi</h2>\r\n                <p>Icon dari aplikasi Discoin ini menggunakan Logo dari merk / brand produk atau usaha anda.</p>\r\n                <p>Ini dimaksudkan agar, suplai sugesti brand untuk pelanggan atau member anda lebih dapat terjadi secara konsisten, karena logo aplikasi anda di taruh di telephone seluler pelanggan anda.</p>\r\n                <p>Dimana telephone genggam, adalah media yang selalu digunakan dan dilihat oleh pelanggan anda.</p>\r\n                <p>Tujuannya, agar konsistensi sugesti brand visual dapat menjadi pengingat tentang usaha anda dan menempel pada ingatan pelanggan anda tentang brand atau merk produk anda.</p>\r\n                <p>Â </p></td>\r\n            </tr>\r\n            <tr>\r\n                <td style=" text-align:justify" valign="top">\r\n                <img src="http://sempoa.biz/files/images/discoin_coin_2.png" style="width:98%; "></td>\r\n                <td valign="top">\r\n                <h2>Kode Identitas Pelanggan</h2>\r\n                <p>Aplikasi Discoin juga memiliki Kode Identitas Pelanggan / member yang disebut COIN (Community Identification Number)</p>\r\n                <p>Kode ini selain sebagai kode identitas pelanggan / member, juga sebagai kode yang dapat di validasi oleh merchant-merchant lain, yang terdapat di aplikasi Discoin, menggunakan akun sempoa masing-masing merchant, saat pelanggan / member anda menikmati layanan diskon belanja komunitas di merchant-merchant tersebut.</p></td>\r\n            </tr>\r\n            <tr>\r\n                <td style=" text-align:justify" valign="top">\r\n                <img src="http://sempoa.biz/files/images/discoin_qrcode_2.png" style="width:98%; "></td>\r\n                <td valign="top">\r\n                <h2>QR Code Identitas Pelanggan</h2>\r\n                <p>COIN (Community Identification Number) juga dapat berupa QR Code</p>\r\n                <p>QR Code dari COIN ini dapat di scan oleh QR Code reader, menggunakan akun sempoa masing-masing merchant, saat pelanggan / member anda menikmati layanan diskon belanja komunitas di merchant-merchant tersebut.</p>\r\n              </td>\r\n                \r\n            </tr>\r\n            <tr>\r\n                <td style=" text-align:justify" valign="top">\r\n                <img src="http://sempoa.biz/files/images/discoin_layanan.png" style="width:98%; "></td>\r\n                <td valign="top">\r\n                <h2>Daftar Diskon Merchant Komunitas</h2>\r\n                <p>Di aplikasi Discoin terdapat daftar merchant mitra yang memberlakukan Diskon belanja bagi Pelanggan / member anda, dan dapat memvalidasi COIN dari aplikasi Discoin yang di unduh pelanggan anda.</p>\r\n                <p>Begitu juga dengan Aplikasi Discoin dari mitra brand komunitas bisnis anda, ditampilkan brand / merk dari usaha anda.</p>\r\n                </td>\r\n            </tr>\r\n            <tr>\r\n                <td style=" text-align:justify" valign="top">\r\n                <img src="http://sempoa.biz/files/images/discoin_katalog.png" style="width:98%; "></td>\r\n                <td valign="top">\r\n                <h2>Profil dan Katalog Usaha</h2>\r\n                <p>Di aplikasi Discoin terdapat fitur katalog produk, dan profil usaha anda yang dapat dilihat oleh pelanggan / member anda dan pelanggan / member dari brand komunitas anda.</p>\r\n                <p>Juga katalog produk, dan profil dari usaha mitra brand komunitas anda dapat dilihat oleh pelanggan / member anda dan pelanggan / member dari brand komunitas anda lainnya.</p>\r\n                </td>\r\n          </tr>\r\n        </tbody></table>\r\n      <p></p>\r\n    </div>\r\n', 'fitur_aplikasi_discoin', '642e92ef', '-21-', 13, 2, 0, '', '1', '2015-06-21'),
