(25, 'statis', 'bottom', 1, 9, 'Syarat dan Ketentuan', 'Syarat dan Ketentuan', 'syarat,ketentuan,sempoa tech', '', '<p></p><p>\r\n\r\n</p><h4>ATURAN UMUM</h4>\r\n\r\n<p></p>\r\n\r\n<p>Syarat dan ketentuan yang ada di dalam halaman ini ("Syarat\r\n&amp; Ketentuan Layanan") mengikat para Pengguna situs web kami <a href="http://www.sempoa.biz,">www.sempoa.biz,</a>\r\nbaik sebagai pengguna terdaftar ataupun pihak yang sekedar berkunjung\r\nmelihat-lihat situs, pemasang iklan, maupun calon pembeli untuk tunduk dan\r\npatuh atas hal-hal yang telah ditetapkan oleh pihak Sempoa Technology</p>\r\n\r\n<p>Dengan mengakses atau menggunakan situs <a href="http://www.sempoa.biz,">www.sempoa.biz,</a> maka\r\nsetiap Pengguna dianggap telah menerima, memahami, menyetujui, serta sepakat\r\nuntuk mematuhi semua isi dalam Syarat &amp; Ketentuan Layanan di bawah ini.\r\nSyarat &amp; Ketentuan Layanan dapat diubah dan/atau diperbaharui sewaktu-waktu\r\noleh Sempoa.biz tanpa ada pemberitahuan terlebih dahulu. Apabila Pengguna tidak\r\nsetuju atas Syarat &amp; Ketentuan Layanan ini, Sempoa.biz mempersilahkan untuk\r\ntidak melanjutkan penggunaan situs <a href="http://www.sempoa.biz.">www.sempoa.biz.</a></p><p><br></p>\r\n<p></p>\r\n<p></p>\r\n<h4>A. DEFINISI<span style="font-size: 15px; line-height: 1.45em; color: rgb(51, 51, 51); background-color: initial;">&nbsp; &nbsp; &nbsp;</span></h4>\r\n<p></p>\r\n<p>\r\n  </p>\r\n   <ul style="list-style:lower-roman; margin-left:20px;">\r\n    <li>Sempoa  Technology adalah sebuah unit usaha yang menjalankan kegiatan usaha jasa dengan 2 produk </li>\r\n    <ul style="list-style:decimal; margin-left:25px">\r\n      <li>Website Multi Komunitas  Brand Bisnis - www.sempoa.biz </li>\r\n      <li>Platform Aplikasi  Discoin untuk Brand di Komunitas sebagai Kartu Member Digital. </li>\r\n    </ul>\r\n    <li>Website Multi  Komunitas Brand Bisnis - Â www.sempoa.biz  adalah</li>\r\n    <ul style="list-style:decimal; margin-left:25px">\r\n      <li>Website tempat  berkumpulnya brand-brand berkualitas dari sisi layanan member loyal.</li>\r\n      <li>Website tempat  berkumpulnya brand-brand bisnis yang memiliki aplikasi Discoin, telepas dari  memiliki komunitas bisnis atau tidak.</li>\r\n      <li>Website tempat  berkumpulnya komunitas-komunitas brand bisnis yang masing-masing komunitas brand  terdiri dari brand bisnis yang berbeda-beda dan berkerja sama dalam membentuk  komunitas member loyal.</li>\r\n      <li>Website tempat  berkumpulnya mall-mall online diskon, yang hanya dapat di akses menggunakan  aplikasi Discoin dari salah satu brand.</li>\r\n      <li>Website Multi  Komunitas sekaligus Website perantara yang meneruskan informasi produk dari  seluruh brand-brand yang terdaftar kepada calon pembeli / netizens (bukan  member loyal komunitas), di sempoa.biz</li>\r\n    </ul>\r\n    <li>Aplikasi  Discoin adalah </li>\r\n    <ul style="list-style:decimal; margin-left:25px">\r\n      <li>Sebuah aplikasi  yang hanya dimiliki oleh Brand Bisnis yang terdaftar di sempoa.biz</li>\r\n      <li>Sebuah Aplikasi  Mobile yang dirancangkan gratis bagi brand-brand bisnis yang terpilih dan  terdaftar di sempoa.biz, </li>\r\n      <li>Sebuah Mobile  Aplikasi yang menggunakan Icon dari Logo Brand Sendiri.</li>\r\n      <li>Sebuah Aplikasi  Mobile yang berfungsi sebagai kartu member digital untuk mengikat member  loyalnya dengan layanan diskon.</li>\r\n      <li>Sebuah Aplikasi  Mobile yang menghubungkan member loyal sebuah brand bisnis dan brand  langgananya secara real time</li>\r\n      <li>Sebuah Aplikasi  Mobile yang dapat menjadi Aplikasi Mall Online dan Aplikasi Daily Deal  Sekaligus.</li>\r\n      <li>Sebuah Aplikasi  yang menghubungkan Member loyal brand dengan Komunitas / Mall Online Diskon  yang di bentuk bersama-sama, baik dibantu oleh sempoa maupun dibentuk oleh  brand itu sendiri.</li>\r\n    </ul>\r\n    <li>Member Loyal  adalah, pelanggan dari brand yang memiliki akun Aplikasi Discoin dari brand  langgannanya.</li>\r\n    <li>Komunitas Brand  adalah, komunitas yang didalamnya terdiri dari brand-brand bisnis yang saling  terhubung secar online.</li>\r\n    <li>Komunitas Brand  Public, adalah komunitas brand yang di bangun oleh Purple / Commnuty Builder  Sempoa</li>\r\n    <li>Komunitas Brand  Private, adalah komunitas brand yang dibangun oleh brand itu sendiri dengan  memilah-milah brand bisnis sebagai mitra kerjasama nya dalam pertukaran layanan  member loyal.</li>\r\n    <li>Komunitas  Member loyal adalah, komunitas member loyal dari masing-masing brand yang  terkumpul menjadi satu dalam komunitas brand untuk dapat menikmati diskon  belanja di komunitas brand.</li>\r\n    <li>Purple /  Community Builder adalah, </li>\r\n    <ul style="list-style:decimal; margin-left:25px">\r\n      <li><em>Person / </em>Orang yang menganalisa dan mencari tahu  prioritas kebutuhan pemasaran dari brand bisnis yang akan mendaftar di  sempoa.biz</li>\r\n      <ul style="list-style:lower-latin; margin-left:25px">\r\n        <li>Apakah prioritas promosi produk atau  promosi brand ? </li>\r\n        <li>Apakah prioritas konsumen biasa atau member  loyal ?</li>\r\n        <li>Apakah hobi berkompetisi atau tidak ?</li>\r\n        <li>Apakah paham pemasaran digital atau tidak ?</li>\r\n        <li>Dan lain-lain.</li>\r\n      </ul>\r\n      <li><em>Person </em>atau orang dari Sempoa Tech yang membantu  brand bisnis dalam membangun komunitas brand</li>\r\n      <li><em>Person </em>/ Orang yang membantu merelasikan brand  satu dengan brand bisnis lainnya.</li>\r\n      <li><em>Person / </em>Orang yang membantu brand dalam membangun  komunitas bisnis yang terbentuk secara virtual.</li>\r\n      <li><em>Person / </em>Orang yang bukan membantu menjualkan  produk.</li>\r\n      <li><em>Person / </em>Orang yang menganalisa pola kebutuhan  member loyal brand agar semakin dekat dengan brand langganannya.</li>\r\n      <li><em>Person / </em>Orang yang menganalisa pola kebutuhan komunitas  brand yang dibangun dan kebutuhan komunitas member loyal yang terbangun</li>\r\n    </ul>\r\n  </ul>\r\n\r\n\r\n<p></p>\r\n', 'syarat_dan_ketentuan', 'cfcd2084', '-25-', 0, 2, 0, '', '1', '2015-08-02'),
